const Total = ({allFeedback, good, bad, neutral}) => {
	return (
			<p>good {good} <br />
			neutral {neutral} <br />
			bad {bad} <br />
			all {allFeedback.length} <br />
			average {parseFloat((good-bad)/(allFeedback.length))} <br />
			positive {parseFloat((good)/(allFeedback.length) * 100)} %</p>
	)
}

export default Total;
